#include <iostream>
#include <string>
#include <vector>

using namespace std;

/**
 * This function splits a given string into substrings based on multiple separators.
 * It returns a formatted string containing the matched substrings and their corresponding separators.
 *
 * @param str The input string to be split.
 * @param separators A vector of separator strings.
 * @return A formatted string containing the matched substrings and their corresponding separators.
 */
string Multisplit(const string& str, const vector<string>& separators) {
    // Initialize an empty vector to store the result
    vector<string> result;

    // Initialize the separator index to 0
    int separator_index = 0;

    // Initialize an empty stack to keep track of delimiter indices
    vector<int> delimiter_stack;

    // Iterate over each character in the input string
    for (int i = 0; i < str.size(); ++i) {
        // Check if the current character matches any separator
        for (int j = separator_index; j < separators.size(); ++j) {
            // If a match is found, update the separator index and push the delimiter index to the stack
            if (str.substr(i, separators[j].size()) == separators[j]) {
                delimiter_stack.push_back(j);
                separator_index = j + 1;
                break;
            }
        }

        // If no separator match is found, add the current substring to the result and continue
        if (j >= separators.size()) {
            // Add the substring from the last separator index to the current index
            result.push_back(str.substr(i));
            continue;
        }

        // Add matched separator information to the result
        result.push_back(separators[j] + " at position " + to_string(i));
    }

    // Pop delimiter stack and append matching substrings to the result
    for (int i = delimiter_stack.size() - 1; i >= 0; --i) {
        int delimiter_index = delimiter_stack[i];
        // Update the corresponding substring in the result with the separator information
        if (!result.empty()) {
            result[delimiter_stack[i + 1]] =
                result[delimiter_stack[i + 1]] + " " + separators[delimiter_index] + " at position " + to_string(delimiter_stack[i]);
        }
        delimiter_stack.pop_back();
    }

    // Format the result as specified and return
    string formatted_result = "";
    for (const string& s : result) {
        formatted_result += s + (delimiter_stack.empty()? "" : " ");
    }
    return formatted_result;
}

int main() {
    string str = "a!===b=!=c";
    vector<string> separators = {"==", "!=", "="};

    string result = Multisplit(str, separators);

    // Expected output: "a" (!=) "" (==) "b" (=) "" (!=) "c"
    cout << result << endl;

    return 0;
}
